import React from 'react';
import logo from './logo.svg';
import './App.css';

function Ziget() {
  return (
    <div className="Ziget">
      <header className="Ziget-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
